            <div  clasName='img'>
                <img src={logo} loading="lazy" style={{ width: '60%', height: '40%' }} align-items='center' alt="" />
            </div>

            <div className='description'>
                <div className='text'>
                    You are the best!
                </div>
            </div>

        </div>
    )
}

export default AddBlock;
